@-moz-document domain("twitter.com") {

/********************************/
/* 16MODES TWITTER THEME BY YAD */
/********************************/


body {
background-image:url("/*[[yadtwbg]]*/"), linear-gradient(20deg, #f17ff8 40%, #12aae6 90%)!important;
background-repeat: no-repeat;
background-attachment:fixed;
background-color: #0fb4e1;
background-position: 100% 100%, center;
background-size: 100%, 100%;
background-blend-mode: /*[[yadmodes]]*/;	
animation: /*[[yadrandom]]*/ 1200s steps(11, end) infinite both;
}
@keyframes yadrandom {
	0% {background-blend-mode: multiply;}
	10% {background-blend-mode: screen;}
	20% {background-blend-mode: overlay;}
	30% {background-blend-mode: darken;}
	40% {background-blend-mode: lighten;}
	50% {background-blend-mode: color-dodge;}
	60% {background-blend-mode: color-burn;}
	70% {background-blend-mode: hard-light;}
	80% {background-blend-mode: exclusion;}
	90% {background-blend-mode: luminosity;}
	100% {background-blend-mode: color;}
}
